import React from "react";
import { createGlobalStyle } from "styled-components";
const GlobalStyle = createGlobalStyle`
  body {
    margin: 0;
    padding: 0;
    color:red;
  }
`;
export default function Layout({ children }) {
  return (
    <div>
      <GlobalStyle />
      Layout
      {children}
    </div>
  );
}
